import React from "react";
import "./Landing.scss";

const Landing = () => {
    return (
        <div className="landing-container">
            <div className="header-container">
                <div className="home-container">
                    <h1>Coog Music</h1>
                    <button>Home</button>
                </div>
                <div className="button-container">
                    <button>Login</button>
                    <button>Sign Up</button>
                </div>
            </div>
            <div className="content-container">
                <h1>
                    A music streaming platform made for the University of
                    Houston.
                </h1>
            </div>
            <div className="footer-container"> Â© 2020, Coog Music, Inc.</div>
        </div>
    );
};

export default Landing;
